.materialBtn {
  position: relative;

  display: block;
  padding: 0;

  overflow: hidden;

  border-width: 0;
  outline: none;
  border-radius: 2px;
  box-shadow: 0 1px 4px rgba(0, 0, 0, .6);

  background-color: #691a99;

  color: #ecf0f1;

  transition: background-color .3s;
}

.materialBtn:hover, .materialBtn:focus {
  background-color: #9b26af;
}

.materialBtn > * {
  position: relative;
}

.materialBtn span {
  display: block;
  padding: 12px 24px;
}

.materialBtn:before {
  content: "";

  position: absolute;
  top: 50%;
  left: 50%;

  display: block;
  width: 0;
  padding-top: 0;

  border-radius: 100%;

  background-color: rgba(236, 240, 241, .3);

  -webkit-transform: translate(-50%, -50%);
  -moz-transform: translate(-50%, -50%);
  -ms-transform: translate(-50%, -50%);
  -o-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
}

.materialBtn:active:before {
  width: 120%;
  padding-top: 120%;

  transition: width .2s ease-out, padding-top .2s ease-out;

}

.app-MyPreps-Button1,
.app-MyPrepsBackup-Button1,
.app-MyPrepsBackup-Button1,

.app-PrepForm-Button1,
.app-PrepForm-Button2
{
